INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "お！\nあそこに困ってそうな人発見！", 0, 1001, 2, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1, 1, 1.4, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "春咲 ひより", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "大切な人を\n守れるようになりたい…って", 0, 1002, 2, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1, 1, 1.4, 0, "みんなみたいに\nわたしも強くならなきゃ", "草野 優衣", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "キミに必要な集中力と感性が", 0, 1003, 2, "少しは磨かれると思いますよ。", 0, 1, 1, 1.4, 0, "フェンシングを始めてみては？", "士条 怜", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "今日はなにして遊ぶ？", 0, 1004, 2, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1, 1, 1.5, 0, "ねぇ、にいちゃん！", "穂高 みそぎ", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "ねぇ…", 0, 1006, 2, "私といっしょに…\nいかない？", 0, 1, 1, 1.4, 0, "風宮あかりです", "風宮 あかり", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "プリンたべたいのー", 0, 1007, 2, "食べ物の恨みは怖いのー", 0, 1, 1, 1.5, 0, "出雲宮子なのー", "出雲 宮子", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1008, 2, "いいよ。\n見られることは運命さ…", 0, 1, 1, 1.4, 0, "ボクは虹村雪。", "虹村 雪", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1009, 2, "人呼んで「疾風の冥姫」!!", 0, 1, 1, 1.4, 0, "フッ…聞いて後悔するがいい！", "柊杏奈", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1010, 2, "ほんまおおきにやわ～♪", 0, 1, 1, 1.5, 0, "マホマホ王国のプリンセス、\nまほ姫どす", "姫宮 真歩", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1011, 2, "ここで会ったが\n100年目～！", 0, 1, 1, 1.4, 0, "衣之咲璃乃です！", "衣之咲 璃乃", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "ち、超能力って…\n何のことかな～？", 0, 1012, 2, "…って、お願い！\n誰にも言わないでおいて～！", 0, 1, 1, 1.4, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "柏崎 初音", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "一応カリスマ読モJKやってまっす！", 0, 1016, 2, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1, 1, 1.4, 0, "ちょす！\n美波鈴奈だよ～♪", "美波 鈴奈", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "東京は遊園地みたいなところさー", 0, 1017, 2, "でも、沖縄もとってもいいとこさー", 0, 1, 1, 1.4, 0, "はいたーい。\n喜屋武香織さー。", "喜屋武 香織", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "先生って呼ばれるのは\nくすぐったいから", 0, 1018, 2, "イオちゃんって呼んでね。", 0, 1, 1, 1.4, 0, "支倉伊緒です。", "支倉 伊緒", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1020, 2, "ミミをおいてかないでぇ～", 0, 1, 1, 1.5, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "茜 ミミ", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "あの……\nふぇ……", 0, 1021, 2, "ふぇぇぇぇぇん……", 0, 1, 1, 1.5, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", "栗林 くるみ", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "こんな私に貴重な時間を\n割いていただき、", 0, 1022, 2, "なんてありがとうございます！", 0, 1, 1, 1.4, 0, "風宮よりです。\nあああああ！", "風宮 より", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "おにいちゃんどこいくの？\nえ？", 0, 1023, 2, "私こっち行きたいー\nね、早く早くー", 0, 1, 1, 1.5, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "北条 綾音", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1025, 2, "これて何か違う…\nあああすみません！", 0, 1, 1, 1.4, 0, "わっ…わっ…私、\n天野すずめといいます！", "天野 すずめ", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "あなたは…運命の……\n伴侶……", 0, 1027, 2, "離しませんわ………\n絶対に…!!", 0, 1, 1, 1.4, 0, "……クスクス…私は\n…倉石恵理子……", "倉石 恵理子", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1028, 2, "…そうでしょ？？", 0, 1, 1, 1.4, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "佐々木 咲恋", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1029, 2, "あはは、\n私もまだまだだなぁ～", 0, 1, 1, 1.4, 0, "桜井望だよ！\nよろしくねっ", "桜井 望", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1030, 2, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1, 1, 1.4, 0, "デケデケデンっ！", "ニノン・ジュベール", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1031, 2, "おかしいですね……", 0, 1, 1, 1.4, 0, "上喜しのぶです。\n手元のドクロが父です。", "上喜 しのぶ", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "けんども\nそれには足りないモンが…", 0, 1033, 2, "そう、\nオラのボケに突っ込める相方が…！", 0, 1, 1, 1.5, 0, "目指すはビッグな\nお笑い芸人だっぺ！", "野戸まひる", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "ちょっと緊張しちゃって…", 0, 1034, 2, "ちょ\nちょっと一杯飲んできます…！", 0, 1, 1, 1.4, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "綾瀬 ゆかり", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "知らない人とは話しちゃいけないので", 0, 1036, 2, "これ以上お話しすることは…\nないです！", 0, 1, 1, 1.5, 0, "氷川鏡華…です", "氷川 鏡華", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "……あ、アラーム。", 0, 1038, 2, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1, 1, 1.4, 0, "柏崎…栞です。", "柏崎 栞", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "私、一人も友達がいなくて……", 0, 1040, 2, "野に咲く花が、\n唯一の話相手です。", 0, 1, 1, 1.4, 0, "ふ、双葉碧です。", "双葉 碧", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1042, 2, "そう思っています。", 0, 1, 1, 1.4, 0, "三角千歌です。", "三角 千歌", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "あぁ？\nお前のそいつの仲間か？", 0, 1043, 2, "う、疑ってすまなかったな…", 0, 1, 1, 1.4, 0, "安芸真琴だ。", "安芸 真琴", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "生けとし生ける全ての者よ！", 0, 1044, 2, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1, 1, 1.4, 0, "わらわこそは夜を総べる者！", "イリヤ・オーンスタイン", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "ぐふふふふ……はっ！", 0, 1045, 2, "ｌク、クウカに何かご用ですか!?", 0, 1, 1, 1.4, 0, "そこで騎士は妖精を乱暴に……", "遠見 空花", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1046, 2, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1, 1, 1.4, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "宮坂たまき", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "それでは早速クエストに…", 0, 1048, 2, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1, 1, 1.4, 0, "大神美冬よ！", "大神 美冬", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "クエストもバトルも\n掃除も洗濯も", 0, 1049, 2, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1, 1, 1.4, 0, "星野静流だよ！", "星野静流", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "見ての通りの\nセクシー美少女で", 0, 1050, 2, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1, 1, 1.5, 0, "アタシは玉泉美咲。", "玉泉美咲", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "？？？？", 0, 1052, 2, "？？？？", 0, 1, 1, 1.4, 0, "？？？", "リマ", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", 0, 1053, 2, "そ、そこまでいうなら\nもらってやる", 0, 1, 1, 1.5, 0, "モニカ・ヴァイスヴィントだ。", "モニカ・ヴァイスヴィント", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", 0, 1058, 2, "そ、そこまでいうなら\nもらってやる", 0, 1, 1, 1.5, 0, "モニカ・ヴァイスヴィントだ。", "ペコリーヌ", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", 0, 1059, 2, "そ、そこまでいうなら\nもらってやる", 0, 1, 1, 1.5, 0, "モニカ・ヴァイスヴィントだ。", "コッコロ", 0, 0);
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", 0, 1060, 2, "そ、そこまでいうなら\nもらってやる", 0, 1, 1, 1.5, 0, "モニカ・ヴァイスヴィントだ。", "キャル", 0, 0);
